import { Component, Vue } from 'vue-property-decorator'
import MarkdownEditor from '@/components/MarkdownEditor/index.vue'
import { getList } from './api'

@Component({
  name: 'Index',
  components: {
    MarkdownEditor
  }
})

export default class extends Vue {
  private list: any[] = []
  created() {
    getList()
      .then((data: any) => {
        console.log(data)
        this.list = data.data || []
      })
      .catch(err => {
        console.log(err)
      })
  }
}
